INSERT INTO `configuracion` VALUES ('descripcion',0,'La Escuela Graduada “Joaquín V. González” fue creada por Decreto del Poder Ejecutivo del 24 de enero de 1906. Con su creación se completaba el proceso educativo dentro de la Universidad, por primera vez en el país. Se lograba, como quería el Presidente de la U.N.L.P., Joaquín V. González, la armonía y continuidad de las distintas etapas de la enseñanza primaria, secundaria y universitaria.\r\nLa Escuela surgió como Anexa a la Sección Pedagógica de la Facultad de Ciencias Jurídicas y Sociales de la Universidad Nacional de La Plata, que se encontraba a cargo del Profesor Víctor Mercante. En 1914 fue anexada a la Facultad de Ciencias de la Educación y en 1920 a la Facultad de Humanidades y Ciencias de la Educación. Actualmente depende de la Presidencia de la U.N.L.P.'),('email',0,'info@anexa.unlp.edu.ar'),('estado_sitio',1,'1'),('mensaje_deshabilitado',0,'El sistema se encuentra deshabilitado por el momento.'),('paginacion',5,'5'),('titulo',0,'Sistema de la Escuela Anexa');
